import React from "react";
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import "./App.css";
import "./components/Navbar";
import Navbar from "./components/Navbar";


const App = () => {
  return (
    <Router>
      <Navbar />

      <Switch>
        <Route path="/" components={Home} exact>
          <Home/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
